import React from 'react'

import Testimonials from '../misc/Testimonials'
import Pricing from '../misc/Pricing'
import Header from '../misc/Header'

export default class Home extends React.Component{
    render() {
    return (
        <React.Fragment>
            <Header />
            <Pricing />
            <Testimonials />
        </React.Fragment>
    )
}
}
